#Language imports

#Test library imports
using Test

#Arithmetic library imports
using IntervalArithmetic

#Preamble
setprecision(53)
setprecision(Interval, Float64)
setrounding(Interval, :tight)
# Set full format, and show decorations
@format full

@testset "FI_LIB.addii" begin
    @test Interval(0x0.0000000000000p+0, 0x0.0000000000000p+0) + Interval(0x0.0000000000000p+0, 0x0.0000000000000p+0) == Interval(0x0.0000000000000p+0, 0x0.0000000000000p+0)
    @test Interval(0x1.0000000000000p+0, 0x1.0000000000000p+0) + Interval(0x2.0000000000000p+0, 0x2.0000000000000p+0) == Interval(0x3.0000000000000p+0, 0x3.0000000000000p+0)
    @test Interval(-0x1.0000000000000p+0, -0x1.0000000000000p+0) + Interval(-0x2.0000000000000p+0, -0x2.0000000000000p+0) == Interval(-0x3.0000000000000p+0, -0x3.0000000000000p+0)
    @test Interval(0x1.0000000000000p+0, 0x1.0000000000000p+0) + Interval(-0x1.0000000000000p+0, -0x1.0000000000000p+0) == Interval(0x0.0000000000000p+0, 0x0.0000000000000p+0)
    @test Interval(-0x1.0000000000000p+0, -0x1.0000000000000p+0) + Interval(0x1.0000000000000p+0, 0x1.0000000000000p+0) == Interval(0x0.0000000000000p+0, 0x0.0000000000000p+0)
    @test Interval(0x1.fa00000000000p-1064, 0x1.fa00000000000p-1064) + Interval(0x1.fa00000000000p-1064, 0x1.fa00000000000p-1064) == Interval(0x3.f400000000000p-1064, 0x3.f400000000000p-1064)
    @test Interval(0x1.fa00000000000p-1064, 0x1.fa00000000000p-1064) + Interval(0x1.0000000000000p+0, 0x1.0000000000000p+0) == Interval(0x1.0000000000000p+0, 0x1.0000000000001p+0)
    @test Interval(-0x1.fa00000000000p-1064, -0x1.fa00000000000p-1064) + Interval(-0x1.fa00000000000p-1064, -0x1.fa00000000000p-1064) == Interval(-0x3.f400000000000p-1064, -0x3.f400000000000p-1064)
    @test Interval(-0x1.fa00000000000p-1064, -0x1.fa00000000000p-1064) + Interval(0x1.0000000000000p+0, 0x1.0000000000000p+0) == Interval(0xf.ffffffffffff8p-4, 0x1.0000000000000p+0)
    @test Interval(0xf.ffffffffffff8p+1020, 0xf.ffffffffffff8p+1020) + Interval(-0x1.0000000000000p+0, -0x1.0000000000000p+0) == Interval(0xf.ffffffffffff0p+1020, 0xf.ffffffffffff8p+1020)
    @test Interval(-0xf.ffffffffffff8p+1020, -0xf.ffffffffffff8p+1020) + Interval(0x1.0000000000000p+0, 0x1.0000000000000p+0) == Interval(-0xf.ffffffffffff8p+1020, -0xf.ffffffffffff0p+1020)
    @test Interval(0x0.0000000000000p+0, 0x1.0000000000000p+0) + Interval(0x1.0000000000000p+0, 0x2.0000000000000p+0) == Interval(0x1.0000000000000p+0, 0x3.0000000000000p+0)
    @test Interval(0x1.0000000000000p+0, 0x2.0000000000000p+0) + Interval(0x0.0000000000000p+0, 0x1.0000000000000p+0) == Interval(0x1.0000000000000p+0, 0x3.0000000000000p+0)
    @test Interval(0x1.0000000000000p+0, 0x2.0000000000000p+0) + Interval(0x3.0000000000000p+0, 0x4.0000000000000p+0) == Interval(0x4.0000000000000p+0, 0x6.0000000000000p+0)
    @test Interval(0x3.0000000000000p+0, 0x4.0000000000000p+0) + Interval(0x1.0000000000000p+0, 0x2.0000000000000p+0) == Interval(0x4.0000000000000p+0, 0x6.0000000000000p+0)
    @test Interval(-0x1.0000000000000p+0, 0x0.0000000000000p+0) + Interval(-0x4.0000000000000p+0, -0x3.0000000000000p+0) == Interval(-0x5.0000000000000p+0, -0x3.0000000000000p+0)
    @test Interval(-0x4.0000000000000p+0, -0x3.0000000000000p+0) + Interval(-0x1.0000000000000p+0, 0x0.0000000000000p+0) == Interval(-0x5.0000000000000p+0, -0x3.0000000000000p+0)
    @test Interval(-0x5.0000000000000p+0, -0x4.0000000000000p+0) + Interval(0x4.0000000000000p+0, 0x5.0000000000000p+0) == Interval(-0x1.0000000000000p+0, +0x1.0000000000000p+0)
    @test Interval(0x4.0000000000000p+0, 0x5.0000000000000p+0) + Interval(-0x5.0000000000000p+0, -0x4.0000000000000p+0) == Interval(-0x1.0000000000000p+0, +0x1.0000000000000p+0)
end

@testset "FI_LIB.subii" begin
    @test Interval(0x0.0000000000000p+0, 0x0.0000000000000p+0) - Interval(0x0.0000000000000p+0, 0x0.0000000000000p+0) == Interval(0x0.0000000000000p+0, 0x0.0000000000000p+0)
    @test Interval(0x1.0000000000000p+0, 0x1.0000000000000p+0) - Interval(0x2.0000000000000p+0, 0x2.0000000000000p+0) == Interval(-0x1.0000000000000p+0, -0x1.0000000000000p+0)
    @test Interval(-0x1.0000000000000p+0, -0x1.0000000000000p+0) - Interval(-0x2.0000000000000p+0, -0x2.0000000000000p+0) == Interval(0x1.0000000000000p+0, 0x1.0000000000000p+0)
    @test Interval(0x1.0000000000000p+0, 0x1.0000000000000p+0) - Interval(-0x1.0000000000000p+0, -0x1.0000000000000p+0) == Interval(0x2.0000000000000p+0, 0x2.0000000000000p+0)
    @test Interval(-0x1.0000000000000p+0, -0x1.0000000000000p+0) - Interval(0x1.0000000000000p+0, 0x1.0000000000000p+0) == Interval(-0x2.0000000000000p+0, -0x2.0000000000000p+0)
    @test Interval(0x1.fa00000000000p-1064, 0x1.fa00000000000p-1064) - Interval(0x1.fa00000000000p-1064, 0x1.fa00000000000p-1064) == Interval(0x0.0000000000000p+0, 0x0.0000000000000p+0)
    @test Interval(0x1.fa00000000000p-1064, 0x1.fa00000000000p-1064) - Interval(0x1.0000000000000p+0, 0x1.0000000000000p+0) == Interval(-0x1.0000000000000p+0, -0xf.ffffffffffff8p-4)
    @test Interval(-0x1.fa00000000000p-1064, -0x1.fa00000000000p-1064) - Interval(-0x1.fa00000000000p-1064, -0x1.fa00000000000p-1064) == Interval(0x0.0000000000000p+0, 0x0.0000000000000p+0)
    @test Interval(-0x1.fa00000000000p-1064, -0x1.fa00000000000p-1064) - Interval(0x1.0000000000000p+0, 0x1.0000000000000p+0) == Interval(-0x1.0000000000001p+0, -0x1.0000000000000p+0)
    @test Interval(0xf.ffffffffffff8p+1020, 0xf.ffffffffffff8p+1020) - Interval(0x1.0000000000000p+0, 0x1.0000000000000p+0) == Interval(0xf.ffffffffffff0p+1020, 0xf.ffffffffffff8p+1020)
    @test Interval(-0xf.ffffffffffff8p+1020, -0xf.ffffffffffff8p+1020) - Interval(-0x1.0000000000000p+0, -0x1.0000000000000p+0) == Interval(-0xf.ffffffffffff8p+1020, -0xf.ffffffffffff0p+1020)
    @test Interval(0x0.0000000000000p+0, 0x1.0000000000000p+0) - Interval(0x1.0000000000000p+0, 0x2.0000000000000p+0) == Interval(-0x2.0000000000000p+0, 0x0.0000000000000p+0)
    @test Interval(0x1.0000000000000p+0, 0x2.0000000000000p+0) - Interval(0x0.0000000000000p+0, 0x1.0000000000000p+0) == Interval(0x0.0000000000000p+0, 0x2.0000000000000p+0)
    @test Interval(0x1.0000000000000p+0, 0x2.0000000000000p+0) - Interval(0x3.0000000000000p+0, 0x4.0000000000000p+0) == Interval(-0x3.0000000000000p+0, -0x1.0000000000000p+0)
    @test Interval(0x3.0000000000000p+0, 0x4.0000000000000p+0) - Interval(0x1.0000000000000p+0, 0x2.0000000000000p+0) == Interval(0x1.0000000000000p+0, 0x3.0000000000000p+0)
    @test Interval(-0x1.0000000000000p+0, 0x0.0000000000000p+0) - Interval(-0x4.0000000000000p+0, -0x3.0000000000000p+0) == Interval(0x2.0000000000000p+0, 0x4.0000000000000p+0)
    @test Interval(-0x4.0000000000000p+0, -0x3.0000000000000p+0) - Interval(-0x1.0000000000000p+0, 0x0.0000000000000p+0) == Interval(-0x4.0000000000000p+0, -0x2.0000000000000p+0)
    @test Interval(-0x5.0000000000000p+0, -0x4.0000000000000p+0) - Interval(0x4.0000000000000p+0, 0x5.0000000000000p+0) == Interval(-0xa.0000000000000p+0, -0x8.0000000000000p+0)
    @test Interval(0x4.0000000000000p+0, 0x5.0000000000000p+0) - Interval(-0x5.0000000000000p+0, -0x4.0000000000000p+0) == Interval(0x8.0000000000000p+0, 0xa.0000000000000p+0)
end

@testset "FI_LIB.mulii" begin
    @test Interval(0x0.0000000000000p+0, 0x0.0000000000000p+0) * Interval(0x0.0000000000000p+0, 0x0.0000000000000p+0) == Interval(0x0.0000000000000p+0, 0x0.0000000000000p+0)
    @test Interval(-0x1.0000000000000p+0, -0x1.0000000000000p+0) * Interval(-0x1.0000000000000p+0, -0x1.0000000000000p+0) == Interval(0x1.0000000000000p+0, 0x1.0000000000000p+0)
    @test Interval(-0x1.0000000000000p+0, -0x1.0000000000000p+0) * Interval(0x0.0000000000000p+0, 0x0.0000000000000p+0) == Interval(0x0.0000000000000p+0, 0x0.0000000000000p+0)
    @test Interval(-0x1.0000000000000p+0, -0x1.0000000000000p+0) * Interval(0x1.0000000000000p+0, 0x1.0000000000000p+0) == Interval(-0x1.0000000000000p+0, -0x1.0000000000000p+0)
    @test Interval(0x0.0000000000000p+0, 0x0.0000000000000p+0) * Interval(-0x1.0000000000000p+0, -0x1.0000000000000p+0) == Interval(0x0.0000000000000p+0, 0x0.0000000000000p+0)
    @test Interval(0x0.0000000000000p+0, 0x0.0000000000000p+0) * Interval(0x1.0000000000000p+0, 0x1.0000000000000p+0) == Interval(0x0.0000000000000p+0, 0x0.0000000000000p+0)
    @test Interval(0x1.0000000000000p+0, 0x1.0000000000000p+0) * Interval(-0x1.0000000000000p+0, -0x1.0000000000000p+0) == Interval(-0x1.0000000000000p+0, -0x1.0000000000000p+0)
    @test Interval(0x1.0000000000000p+0, 0x1.0000000000000p+0) * Interval(0x0.0000000000000p+0, 0x0.0000000000000p+0) == Interval(0x0.0000000000000p+0, 0x0.0000000000000p+0)
    @test Interval(0x1.0000000000000p+0, 0x1.0000000000000p+0) * Interval(0x1.0000000000000p+0, 0x1.0000000000000p+0) == Interval(0x1.0000000000000p+0, 0x1.0000000000000p+0)
    @test Interval(0xf.ffffffffffff8p+1020, 0xf.ffffffffffff8p+1020) * Interval(0x8.0000000000000p-4, 0x8.0000000000000p-4) == Interval(0x7.ffffffffffffcp+1020, 0x7.ffffffffffffcp+1020)
    @test Interval(-0xf.ffffffffffff8p+1020, -0xf.ffffffffffff8p+1020) * Interval(0x8.0000000000000p-4, 0x8.0000000000000p-4) == Interval(-0x7.ffffffffffffcp+1020, -0x7.ffffffffffffcp+1020)
    @test Interval(0x1.fa00000000000p-1064, 0x1.fa00000000000p-1064) * Interval(0x1.fa00000000000p-1064, 0x1.fa00000000000p-1064) == Interval(0x0.0000000000000p+0, 0x4.0000000000000p-1076)
    @test Interval(0x1.fa00000000000p-1064, 0x1.fa00000000000p-1064) * Interval(0x1.0000000000000p+0, 0x1.0000000000000p+0) == Interval(0x1.fa00000000000p-1064, 0x1.fa00000000000p-1064)
    @test Interval(0x1.fa00000000000p-1064, 0x1.fa00000000000p-1064) * Interval(-0x1.0000000000000p+0, -0x1.0000000000000p+0) == Interval(-0x1.fa00000000000p-1064, -0x1.fa00000000000p-1064)
    @test Interval(-0x3.0000000000000p+0, -0x2.0000000000000p+0) * Interval(-0x3.0000000000000p+0, -0x2.0000000000000p+0) == Interval(0x4.0000000000000p+0, 0x9.0000000000000p+0)
    @test Interval(-0x3.0000000000000p+0, -0x2.0000000000000p+0) * Interval(-0x1.0000000000000p+0, +0x1.0000000000000p+0) == Interval(-0x3.0000000000000p+0, +0x3.0000000000000p+0)
    @test Interval(-0x3.0000000000000p+0, -0x2.0000000000000p+0) * Interval(0x2.0000000000000p+0, 0x3.0000000000000p+0) == Interval(-0x9.0000000000000p+0, -0x4.0000000000000p+0)
    @test Interval(-0x1.0000000000000p+0, +0x1.0000000000000p+0) * Interval(-0x3.0000000000000p+0, -0x2.0000000000000p+0) == Interval(-0x3.0000000000000p+0, +0x3.0000000000000p+0)
    @test Interval(-0x1.0000000000000p+0, +0x1.0000000000000p+0) * Interval(-0x1.0000000000000p+0, +0x1.0000000000000p+0) == Interval(-0x1.0000000000000p+0, +0x1.0000000000000p+0)
    @test Interval(-0x1.0000000000000p+0, +0x1.0000000000000p+0) * Interval(0x2.0000000000000p+0, 0x3.0000000000000p+0) == Interval(-0x3.0000000000000p+0, +0x3.0000000000000p+0)
    @test Interval(0x2.0000000000000p+0, 0x3.0000000000000p+0) * Interval(-0x3.0000000000000p+0, -0x2.0000000000000p+0) == Interval(-0x9.0000000000000p+0, -0x4.0000000000000p+0)
    @test Interval(0x2.0000000000000p+0, 0x3.0000000000000p+0) * Interval(-0x1.0000000000000p+0, +0x1.0000000000000p+0) == Interval(-0x3.0000000000000p+0, +0x3.0000000000000p+0)
    @test Interval(0x2.0000000000000p+0, 0x3.0000000000000p+0) * Interval(0x2.0000000000000p+0, 0x3.0000000000000p+0) == Interval(0x4.0000000000000p+0, 0x9.0000000000000p+0)
    @test Interval(-0x5.0000000000000p+0, +0x2.0000000000000p+0) * Interval(-0x4.0000000000000p+0, +0x3.0000000000000p+0) == Interval(-0xf.0000000000000p+0, +0x1.4000000000000p+4)
    @test Interval(-0x5.0000000000000p+0, +0x2.0000000000000p+0) * Interval(-0x3.0000000000000p+0, +0x8.0000000000000p+0) == Interval(-0x2.8000000000000p+4, +0x1.0000000000000p+4)
    @test Interval(-0x2.0000000000000p+0, +0x5.0000000000000p+0) * Interval(-0x4.0000000000000p+0, +0x3.0000000000000p+0) == Interval(-0x1.4000000000000p+4, +0xf.0000000000000p+0)
    @test Interval(-0x4.0000000000000p+0, +0x5.0000000000000p+0) * Interval(-0x4.0000000000000p+0, +0x3.0000000000000p+0) == Interval(-0x1.4000000000000p+4, +0x1.0000000000000p+4)
    @test Interval(-0x3.0000000000000p+0, 0x0.0000000000000p+0) * Interval(-0x3.0000000000000p+0, -0x2.0000000000000p+0) == Interval(0x0.0000000000000p+0, 0x9.0000000000000p+0)
    @test Interval(-0x3.0000000000000p+0, 0x0.0000000000000p+0) * Interval(-0x1.0000000000000p+0, +0x1.0000000000000p+0) == Interval(-0x3.0000000000000p+0, +0x3.0000000000000p+0)
    @test Interval(-0x3.0000000000000p+0, 0x0.0000000000000p+0) * Interval(0x2.0000000000000p+0, 0x3.0000000000000p+0) == Interval(-0x9.0000000000000p+0, 0x0.0000000000000p+0)
    @test Interval(-0x3.0000000000000p+0, -0x2.0000000000000p+0) * Interval(-0x3.0000000000000p+0, 0x0.0000000000000p+0) == Interval(0x0.0000000000000p+0, 0x9.0000000000000p+0)
    @test Interval(-0x3.0000000000000p+0, -0x2.0000000000000p+0) * Interval(0x0.0000000000000p+0, 0x3.0000000000000p+0) == Interval(-0x9.0000000000000p+0, 0x0.0000000000000p+0)
    @test Interval(-0x1.0000000000000p+0, +0x1.0000000000000p+0) * Interval(-0x3.0000000000000p+0, 0x0.0000000000000p+0) == Interval(-0x3.0000000000000p+0, +0x3.0000000000000p+0)
    @test Interval(-0x1.0000000000000p+0, +0x1.0000000000000p+0) * Interval(0x0.0000000000000p+0, 0x3.0000000000000p+0) == Interval(-0x3.0000000000000p+0, +0x3.0000000000000p+0)
    @test Interval(0x0.0000000000000p+0, 0x3.0000000000000p+0) * Interval(-0x3.0000000000000p+0, -0x2.0000000000000p+0) == Interval(-0x9.0000000000000p+0, 0x0.0000000000000p+0)
    @test Interval(0x0.0000000000000p+0, 0x3.0000000000000p+0) * Interval(-0x1.0000000000000p+0, +0x1.0000000000000p+0) == Interval(-0x3.0000000000000p+0, +0x3.0000000000000p+0)
    @test Interval(0x0.0000000000000p+0, 0x3.0000000000000p+0) * Interval(0x2.0000000000000p+0, 0x3.0000000000000p+0) == Interval(0x0.0000000000000p+0, 0x9.0000000000000p+0)
    @test Interval(0x2.0000000000000p+0, 0x3.0000000000000p+0) * Interval(-0x3.0000000000000p+0, 0x0.0000000000000p+0) == Interval(-0x9.0000000000000p+0, 0x0.0000000000000p+0)
    @test Interval(0x2.0000000000000p+0, 0x3.0000000000000p+0) * Interval(-0x3.0000000000000p+0, 0x0.0000000000000p+0) == Interval(-0x9.0000000000000p+0, 0x0.0000000000000p+0)
    @test Interval(0x0.0000000000000p+0, 0x2.0000000000000p+0) * Interval(-0x3.0000000000000p+0, 0x0.0000000000000p+0) == Interval(-0x6.0000000000000p+0, 0x0.0000000000000p+0)
    @test Interval(-0x1.fa00000000000p-1064, -0x1.fa00000000000p-1064) * Interval(-0x1.fa00000000000p-1064, -0x1.fa00000000000p-1064) == Interval(0x0.0000000000000p+0, 0x4.0000000000000p-1076)
    @test Interval(-0x1.fa00000000000p-1064, -0x1.fa00000000000p-1064) * Interval(0x1.0000000000000p+0, 0x1.0000000000000p+0) == Interval(-0x1.fa00000000000p-1064, -0x1.fa00000000000p-1064)
    @test Interval(-0x1.fa00000000000p-1064, -0x1.fa00000000000p-1064) * Interval(-0x1.0000000000000p+0, -0x1.0000000000000p+0) == Interval(0x1.fa00000000000p-1064, 0x1.fa00000000000p-1064)
    @test Interval(-0x1.fa00000000000p-1064, -0x1.fa00000000000p-1064) * Interval(0x1.fa00000000000p-1064, 0x1.fa00000000000p-1064) == Interval(-0x4.0000000000000p-1076, 0x0.0000000000000p+0)
    @test Interval(-0x1.fa00000000000p-1064, -0x1.fa00000000000p-1064) * Interval(0x0.0000000000000p+0, 0x0.0000000000000p+0) == Interval(0x0.0000000000000p+0, 0x0.0000000000000p+0)
    @test Interval(0x1.fa00000000000p-1064, 0x1.fa00000000000p-1064) * Interval(0x0.0000000000000p+0, 0x0.0000000000000p+0) == Interval(0x0.0000000000000p+0, 0x0.0000000000000p+0)
end

@testset "FI_LIB.divii" begin
    @test Interval(-0x1.0000000000000p+0, -0x1.0000000000000p+0) / Interval(-0x1.0000000000000p+0, -0x1.0000000000000p+0) == Interval(0x1.0000000000000p+0, 0x1.0000000000000p+0)
    @test Interval(-0x1.0000000000000p+0, -0x1.0000000000000p+0) / Interval(0x1.0000000000000p+0, 0x1.0000000000000p+0) == Interval(-0x1.0000000000000p+0, -0x1.0000000000000p+0)
    @test Interval(0x0.0000000000000p+0, 0x0.0000000000000p+0) / Interval(-0x1.0000000000000p+0, -0x1.0000000000000p+0) == Interval(0x0.0000000000000p+0, 0x0.0000000000000p+0)
    @test Interval(0x0.0000000000000p+0, 0x0.0000000000000p+0) / Interval(0x1.0000000000000p+0, 0x1.0000000000000p+0) == Interval(0x0.0000000000000p+0, 0x0.0000000000000p+0)
    @test Interval(0x1.0000000000000p+0, 0x1.0000000000000p+0) / Interval(-0x1.0000000000000p+0, -0x1.0000000000000p+0) == Interval(-0x1.0000000000000p+0, -0x1.0000000000000p+0)
    @test Interval(0x1.0000000000000p+0, 0x1.0000000000000p+0) / Interval(0x1.0000000000000p+0, 0x1.0000000000000p+0) == Interval(0x1.0000000000000p+0, 0x1.0000000000000p+0)
    @test Interval(0xf.ffffffffffff8p+1020, 0xf.ffffffffffff8p+1020) / Interval(0x2.0000000000000p+0, 0x2.0000000000000p+0) == Interval(0x7.ffffffffffffcp+1020, 0x7.ffffffffffffcp+1020)
    @test Interval(-0xf.ffffffffffff8p+1020, -0xf.ffffffffffff8p+1020) / Interval(0x2.0000000000000p+0, 0x2.0000000000000p+0) == Interval(-0x7.ffffffffffffcp+1020, -0x7.ffffffffffffcp+1020)
    @test Interval(0x1.fa00000000000p-1064, 0x1.fa00000000000p-1064) / Interval(0x1.fa00000000000p-1064, 0x1.fa00000000000p-1064) == Interval(0x1.0000000000000p+0, 0x1.0000000000000p+0)
    @test Interval(0x1.fa00000000000p-1064, 0x1.fa00000000000p-1064) / Interval(0x1.0000000000000p+0, 0x1.0000000000000p+0) == Interval(0x1.fa00000000000p-1064, 0x1.fa00000000000p-1064)
    @test Interval(0x1.fa00000000000p-1064, 0x1.fa00000000000p-1064) / Interval(-0x1.0000000000000p+0, -0x1.0000000000000p+0) == Interval(-0x1.fa00000000000p-1064, -0x1.fa00000000000p-1064)
